import React from "react";
import arrival from "../data/arrival.json";
console.log(arrival);

export default class Arrivals extends React.Component {
  render() {
    return (
      <section className="arrivals">
        <h4 className="product__phrase">new arrivals</h4>
      </section>
    );
  }
}
